function getChat() {
    return document.querySelector("#chat");
}

function loadMessages(messages) {
    var chat = getChat();
    var msg, row, element, time, textOutput, lastElement, lastDirection;
    for (var i = 0; i < messages.length; i++) {
        msg = messages[i];
        row = document.createElement("div");
        row.classList.add("row");
        element = document.createElement("div");
        element.classList.add("message");
        row.appendChild(element);
        if (msg.type === "chat") {
            textOutput = minEmoji(msg.text.replace(/\n/g, "<br>").replace(/\s/g, '&thinsp;'));
            element.innerHTML = textOutput;
            time = document.createElement("span");
            time.textContent = msg.time;
            time.classList.add("time");
            element.appendChild(time);
        }
        if (msg.direction === "out") {
            element.classList.add("out");
            row.classList.add("out");
        } else {
            element.classList.add("in");
            row.classList.add("in");
        }
        chat.appendChild(row);
        if (lastElement && lastDirection !== msg.direction) {
            lastElement.classList.add("before");
        }
        lastElement = element;
        lastDirection = msg.direction;
    }
    lastElement.classList.add("before");
}

function init() {
    loadMessages(data);
}

window.addEventListener("load", init);
